// SPDX-License-Identifier: MIT
// compiler version must be greater than or equal to 0.8.20 and less than 0.9.0
pragma solidity ^0.8.20;

contract Nhap {
    enum TYPE {
        STEEL,
        IRON,
        WOOD,
        BRICK
    }

    struct Ben {
        string name;
        string add;
        string contact;
    }

    struct Transaction {
        Ben b;
        uint amount;
        TYPE t;
        string description;
        uint day;
        uint month;
        uint year;
    }

    Transaction[] history;

    function addTransaction(Transaction memory newTransaction) public  {

    }
}

